import React from "react";

class NASARow extends React.Component {
  render() {
    return (
      <table key={nasaItem.id}>
        <tbody>
          <tr>
            <td>
              <img alt="item graphic" width="75" src={nasaItem.image_src} />
            </td>
            <td>
              <small>{nasaItem.centre}</small>
              <p>
                <strong>{nasaItem.title}</strong>
              </p>
              <p>{nasaItem.description}</p>
            </td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default NASARow;
